    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Fergus Falls Wetland Management District for
    the next 15 years. This plan outlines the District vision and purpose and describes
    how Fergus Falls Wetland Management District will contribute to the overall mission
    of the Refuge System. The plan provides an introduction to the WMD, an overview
    of the CCP process, a description of the environment and the management direction,
    and strategies for implementation and monitoring. Key planning issues include: wildlife
    and habitat, public use, and operations.",nt"license_title": "License Not
